  <script src="../libs/gpsx.js"></script>

<body style="height: 85vh; margin-top: 10px; ">

  <!-- https://codesandbox.io/embed/4mrnhq?view=Editor+%2B+Preview&module=%2Fjs%2Fmodal.js -->

  <div class="container" 
        style=" height: inherit; 
                display: flex;
                flex-direction: column;
                align-content: center;
                ">

    <div style="flex-basis: 6%; display: flex; flex-direction: row;"> 

      <!-- On change update route select -->
      <input type="date" id="dateselect"> 
      
      <select id="routeselect">
        <option selected disabled value="">Route</option>
      </select>

      <div>

        <button id="loadRouteBtn" onClick="formData()" style="min-width: 70px;">Go</button>
      </div>

    </div>

    <div id="map" style="flex-basis: 78%; margin-bottom: 10px;"></div>

    <div style="flex-basis: 6%;" role="group">
      <button data-target="modal-example" onclick="toggleModal(event)" style="width: 80%; margin-right: 5px;">Times</button>
      <button data-target="modal-gps-settings" onclick="toggleModal(event)"><img src="../images/settings.svg" alt="settings" style="height: 20px; width: 20px; -webkit-filter: invert(100%); filter: invert(100%);"></button>
    </div>
  
  </div>

<dialog id="modal-example">
  <article>
    <table class="striped">
      <thead>
        <tr>
          <th scope="col">Prop #</th>
          <th scope="col">Name</th>
          <th scope="col">Time IN</th>
          <th scope="col">Time OUT</th>
        </tr>
      </thead>
      <tbody id="routelist">
        <!-- <tr>
          <th>980</th>
          <td>AVALON NEWCASTLE COMMONS</td>
          <td>0.39</td>
          <td>88</td>
        </tr>
        <tr>

          <th>980</th>
          <td>AVALON NEWCASTLE COMMONS</td>
          <td>1.52</td>
          <td>687</td>
        </tr> -->
      </tbody>
    </table>


    <footer>
      <button onclick="" class="secondary">
        Cancel
      </button>
      <button data-target="modal-example" onclick="toggleModal(event)">Confirm</button>
    </footer>
  </article>
</dialog>

<dialog id="modal-gps-settings">
  <article>
    <h2>Map Settings</h2>
    <div style="display:flex;flex-direction: column;align-items: center;gap:10px;">
      <a href="#" data-theme-switcher="toggle" title="Toggle Theme" style="color: var(--pico-contrast); font-size: 1.5em;">â˜€</a>
      <details class="dropdown">
        <summary role="button" class="secondary">Theme</summary>
        <ul>
          <li><a href="#" data-theme-switcher="auto">Auto</a></li>
          <li><a href="#" data-theme-switcher="light">Light</a></li>
          <li><a href="#" data-theme-switcher="dark">Dark</a></li>
        </ul>
      </details>
      
      <button onClick="changeLight()">Light Map</button>
      <button onClick="changeDark()">Dark Map</button>
      <button onclick="window.localStorage.clear()" class="secondary">
        Logout DropBox
      </button>      
    </div>

    <footer>
      <button data-target="modal-gps-settings" onclick="toggleModal(event)">Confirm</button>
    </footer>
  </article>
</dialog>

    async function loadPropsFile() {
      sRte = new GPXRoute()

      var data = await getFileData("props.dat")
      await sRte.textDecompressAsync(data)

      sRte.pointsToRouteSegments()
    }

    async function imagetest() {
      let image_path = "./car.jpg";
      let body = new FormData();
      //body.append("upload", fs.createReadStream(image_path));
      body.append('upload', base64Image);
      //body.append("regions", "us-ca"); // Change to your country
      fetch("https://api.platerecognizer.com/v1/plate-reader/", {
        method: "POST",
        headers: {
          Authorization: "Token f246a3345539f99b7fe32e933c3c070fa0cf30b1",
        },
        body: body,
      })
        .then((res) => res.json())
        .then((json) => console.log(json))
        .catch((err) => {
          console.log(err);
        });
    }

    // file from filename.
    async function getFileData(fileName) {
      var xmlString = ""
      await fetch(fileName)
        .then(response => response.text())
        .then(fileData => {
          xmlString = fileData
        });
      return xmlString
    }

    // Render a list of items to #files
    function renderItems(items) {
      var filesContainer = document.getElementById('files');
      items.forEach(function(item) {
        var li = document.createElement('li');
        li.innerHTML = item.name;
        filesContainer.appendChild(li);
      });
    }

  </script>
